import React, { Component } from "react";

const Checkout = () => {
  return (
    <div className="card checkout-card">
      <div className="card-body">
        <h3 className="card-title">Thank You</h3>
        <p className="card-text">Your Order is Confirmed.</p>
      </div>
    </div>

  );
};

export default Checkout;
